def build_x_numb_python_file():
    for i in range(len(edit_res_case)):
        rename_modify_type = edit_res_case[i][7].replace('Modify', '')  # TEST_CASE_INFO[7]Modify
        modify_name = f"Modify{rename_modify_type}"     # py
        if edit_res_case[i][4] == "Power Off" or edit_res_case[i][9] == "Power Off" \
                or edit_res_case[i][4] == "Power On" or edit_res_case[i][9] == "Power On":
            # pypython3 xxx.py
            python_file_path = "Modify_{}_{}_{}_{}_{}_{}_{}.py".format(edit_res_case[i][0], edit_res_case[i][2],
                                                                       edit_res_case[i][3],
                                                                       edit_res_case[i][4].replace(" ", ''),
                                                                       modify_name, edit_res_case[i][8],
                                                                       edit_res_case[i][9].replace(" ", ''))
        else:
            python_file_path = "Modify_{}_{}_{}_{}_{}_{}_{}.py".format(edit_res_case[i][0], edit_res_case[i][2],
                                                                       edit_res_case[i][3], edit_res_case[i][4],
                                                                       modify_name, edit_res_case[i][8],
                                                                       edit_res_case[i][9])
        with open(python_file_path, "a+") as fo:
            for j in range(len(read_data)):
                if "choice_case_numb =" in read_data[j]:
                    fo.write("choice_case_numb = {}\n".format(int(edit_res_case[i][0])))
                elif "case_info" in read_data[j]:
                    fo.write(f"case_info = {edit_res_case[i]}\n")
                else:
                    fo.write(read_data[j])


build_x_numb_python_file()
